import React from 'react';

import style from './Movie.module.css';

const Planet = (props) => {
  return (
    <div>
    <li className={style.movie}>
    <h1>{props.id}</h1>
    <img/>
    <h3>{props.climate}</h3>
    <h3>{props.terrain}</h3>
    <h2>{props.pops}</h2>
  </li>
  </div>
  );
};

export default Planet;
